import React from 'react';
import styles from '../styles/previousNext.module.scss';

function PreviousNext() {

    return (
        <div>
            <div className={styles.previous}>
                <a href=""></a>
            </div>
            <div className={styles.next}>
                <a href=""></a>
            </div>
        </div>
    )
}

export default PreviousNext;
